		"text": "혐스일 보고 알게모르게 캐해석 영향받은 것도 있는 것 같지만 제일 큰 변화는 시장님이 스팬담과 엮였을 때를 접하고 빙산×원작팬담까지 진짜로 파게 된 것 정도... 하지만 팬담이랑 장관님은 역시 별개의 캐릭터고 둘 다 파게 된 나의 인생은 망햇군ㅅㅂ",
