		"id_str": "888752597095464960",
		"text": "오장님 눈에 뭐가 들어가서 한쪽 눈 찡긋거리다 터포키 불렀음 좋겠다. 이미 굳은 터포키한테 좀 봐달라고 고개 내밀면 차라리 뛰어내리고싶은 터포키가 한참 후에야 부들거리며 얼굴 쪽으로 손 올리고... 악 터포키 손 보고싶다.",
