		"text": "아무리 생각해도 트라우마 백퍼 생길거같은데 잘 생활하다가 가끔씩 정신놓지않을까 갑자기 주저앉아서 고통을 호소한다던지 환상통같이 그 상황때와 같은 고통으로 괴로워하거나,,,,십분이나 삼십분이면 괜찮아지는데",
