		"id_str": "888436739232022528",
		"in_reply_to_user_id": 877195967023403000,
		"text": "비블카드 들고 장관을 찾으러 온 CP0이 말도 한 번 못 붙여보고 멀리서 바라만 보다가 끝내 그들끼리 돌아가도록 잘 살았으면 좋겠다. 좋은 이웃도 있고, 좋은 친구도 있는 조용하고 아무일 없는 삶을 살길 바라",
