		"id_str": "888436194744221696",
		"in_reply_to_user_id": 877195967023403000,
		"text": "그러나 아무것도 알 수 없어서 민간인 신분인 자신과 에니에스로비 장관인 스팬담의 거리감을 여실히 느낄 것 같음. 유일하게 속내를 터놓을 수 있는 친구라고 허울좋게 말했지만 정작 생사조차 알 수 없어서 자괴감 드는 시쟝님",
