		"geo": {},
		"id_str": "888436102020726784",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관으로 있을 때보다 훨씬 많이 웃는 장관님... 스팬담이라는 이름도 버리고 원래 이름 혹은 다른 이름으로 살아가면 좋겠다. 누가 봐도 저 사람 정말 평범하게 잘 살고 있구나 하는 생각이 들게끔 잘 살았으면 좋겠다.",
