		"geo": {},
		"id_str": "888435232667455489",
		"text": "정상결전 후 2주나 흘렀다는데 시장님 마음은 이미 까맣게 타서 잿가루가 됐을 것 같다. 매일 아침마다 신문 확인하고 자기 인맥 총동원해서 소식 알아보고 낮에는 평소처럼 일하다가 밤에 술 12754346병 먹으며 후회하고. 날이 갈수록 초췌해지는 시장님",
		"id": 888435232667455500,
