		"text": "전 CP9들한테 명령할 수 있는 권리가 없어졌지만 전 CP9를 의지할 이유랑 관심가질 (원래 하지도 않았지만) 이유도 같이 없어졌네,, 전 CP9 얻은게 뭐냐 장관님의 앞으로의 경계심과 더 심해진 무관심?",
