		"id_str": "888389507216625666",
		"text": "CP0 저렇게 하대하고 그래놓구선 장관님이 곤란할 때 자기들 안부르고 자기 소속 CP들 부르면 서운해 할거면서... 이제 &gt;&gt;CP0님들&lt;&lt; 제 소속 아니시잖아요, 하면 서운함 Max 찍을거면서...",
