		"text": "저 상황에서 장관님 또 자기 쓰러질 것 같은 예감이 드니까 쓰러지기 직전에 굳이 옆에 있던 cp0 냅두고 멀리서 주먹만 쥐고 있던 터포키 불러서 자기 좀 도와달라 하고 정신 잃어라. cp0들 되게 찜찜한 기분 느끼겠지만 몰라 이놈들아 벌이다",
