		"id_str": "888331530849800192",
		"in_reply_to_user_id": 877195967023403000,
		"text": "오늘 썰 보면 장관님 스팬담이랑 2번째 친구 먹을각인데 실제론 장관님 자기 부정에 가깝게 스팬담 극혐하고, 스팬담은 자기 몸 뺏기고 그 몸 엉망으로 다치게 만들고 그 덕에 자긴 8년간 그 누구도 보지 못하고 만지지도 못하고 먹지도 못하는 유령 되버려서",
