		"id_str": "888331338696187904",
		"in_reply_to_user_id": 877195967023403000,
		"text": "그러면서 속으로 얘 커서 진짜 기린되는데. 하고 생각할 것 같다. 그 때 못 먹었던 소프트 아이스크림이랑 솜사탕도 사먹자. 놀이기구는 장관님이 탈 수 있을거 대강 골라서 타고. 둘이 범퍼카 운전해도 재미있겠다. 야, 쟤가 우리 쳤어 가서 들이박아!",
