		"in_reply_to_user_id": 877195967023403000,
		"text": "카쿠는 장관이 안타는데 그걸 내가 왜 타나? 하고 안탈거고. 왜냐하면 자기는 호위하러 온거니까. 타고 싶으면 타도 되는데. 하는 장관을 조금 이상하게 바라봐도 좋을 것 같다. 장관님 둘러보다가 기린 무늬의 머리띠 픽 웃으면서 사다가 카쿠한테 씌워주고.",
