		"text": "또 가면쓰고 가서 지난 번에 루치랑 갔을 때 못 타본 거 타보고 못 먹어본거 많이 먹고. 롤러코스터는 가만히 보다가 ... 저건 타고 싶으면 너 혼자 타라. 하고 말하겠지. 그 때 그렇게 고생했으니까...",
