		"text": "함께 자기 몸에 빙의한 고삼 불쌍히 여길거 같고.... 솔직히 8년이면 처음과 달리 화도 좀 식고 나름 체념하고 객관적으로 고삼이랑 자기 몸 볼거 같아요. 내 몸이랑 쟤도 멀쩡하면 좋겠다고 점점 측은해할거 같고.",
