		"text": "장관님은 딱히 좋아하지도 않고 오히려 싫어하는 삼촌이 막 아는 척 하고 낄낄거리는 기분일거 같아요! 스팬담은 첨엔 자기 몸 뺏은 놈이라고 장관님 극혐하다가 막 구르고 구르는거 보면서 허걱하고 내 몸ㅂㄷㅂㄷ 하다가 너무 구르니까 자기 몸 건강이랑",
