		"text": "헉 유령 스팬담 그려주신 존잘님이신가요?? 감사합니다ㅠㅜㅜㅠ 아 진짜 주임 모습으로 그리신거 보고 허억 무릎 갈리고 심장 박살나고ㅠㅜㅜㅠ 주임 스팬담 올백인거 넘 쩔어요!! 오다쌤 빅 픽쳐....ㅋㅋㅋㄱ 유령 스팬담이 장관님 애취급하는거 넘 조아요",
