		"text": "마마마맞아요ㅠㅜㅜㅠ 스팬담은 자기 30살정도로 생각하고 고삼이는 19으로 생각해서 스팬담한테 고삼이는 언제나 아직 어린애같은 느낌이고ㅠㅜㅜㅠㅜ 그랬으면 좋겠어요 그래서 주임때 모습으로 그렸고ㅠㅠㅠㅠ",
