		"text": "붉은개는 방식이 과격한만큼 반감도 많은 인간이라 그 정도 관계만 되도 양호한거다 주변에 적이 없도록 의도한건지 원래 천성이 그런 인간인건지는 모르겠지만 여태까지의 전적으로 봐서는 아마 의도한거겠지 위험도로 따졌을때 기준에 따라서는 원수보다 위험한 자다",
