		"text": "하다못해 해군원수의 인망도 이렇게 높지는 않다 그런데 저 장관은 정말로 적이 없다 부하들 중 누구도 그를 싫어하지 않아 같은 세력 내에 적이 없다니 말도 안되게 위험한 인간이지 붉은개와는 사이가 좋지는 않은것 같지만",
