		"text": "드래곤은 장관님한테 어떤 감정선을 가졌을지 궁금하긴 한데 개인적인 취향으로는 분노였으면 좋겠어요 왜냐면 아무리 봐도 자신들의 동기/이념/사상을 완벽하게 이해하고 그 가치도 인정하고 있는것 같은데 그럼에도 불구하고 장관직을 하고 있는 사람이라서...",
