		"text": "아...이거 좀 위험한 만남이다.. 스승의 원수가 되어야했고 스파이를 보내 통수도 치려했었을 사람과 전말을 모르는 사람과의 만남이라.. 그치만 그거 다 얘기안하는 스판담이었으면 좋겠다ㅎ\n\n스 : 인사도 끝났으니 본론으로 들어가지 헤어져\n아 : 엄머?!",
