		"text": "스팬담이 얄밉게 굴지만 고삼이 싫어하지 않는다는거 너무좋고 그런의미에서 스파&lt;-&gt;고삼 자주 바뀌는 걸 알고있는 주변사람들도 보고싶다 특히 아이스버그...\n\n스 : 안녕? 니가 내 친구의 친구라며?\n아 : 엄머 그러고보니 우린 초면인가?",
