		"text": "맞아요 후쿠로가 임무 나가는 모든 곳에 장관님의 그..것이 퍼져나갈거야...(아련\n그래도 씨피애들은 무한한 존경심으로 커버가능하지 않을까요?\nCp:장관님!! 인간적인 매력까지 겸비하시다니 젠장 오늘부터 장관님께 조공보내드리자~!~!",
