		"text": "감정 쏟아내는데에는 내 경험상 지쳐서 잠들때까지 펑펑 우는게 최고인데 장관님 그렇게 울어줄 때 됐잖어....힘든거 참지말고 집무실이던 침대 위에서던 시원하게 한번 울었음 좋겠다. 주위에서는 식겁하고 난리나겠지만 장관님은 울고나서 한결 나아지겠지😂😂",
