		"geo": {},
		"id_str": "887593076226629632",
		"in_reply_to_user_id": 877195967023403000,
		"text": "루치가 해 봤는데 다 할 수 있는 거였어! 깐따삐아 깐따삐아 루치가 해 봤는데 왜 자꾸 안된다고 그러는 거야 장관? 그것도 모르다니.. 장관은 역시 내가 없으면 뭐 아는 것도 할 줄 아는 것도 없네... 같은 또치 좋아여...좋아....",
		"id": 887593076226629600,
		"in_reply_to_status_id": 887592445772406800,
		"created_at": "2017-07-19 08:40:54 +0000",
