		"geo": {},
		"id_str": "887592445772406784",
		"in_reply_to_user_id": 877195967023403000,
		"text": "뭐든 직접 몸으로 경험 해 보지 않고는 자기가 하는 게 어떤 결과를 초래할 지 잘 모르는 또치, 자기가 경험한 것만 믿는 또치 귀엽지 않나요? 바다레일? 달릴수 있지! 흰옷입고 암살? 할수 있지! 월보로 중환자 이동? 할수있지!",
		"id": 887592445772406800,
