		"id_str": "887591291499888640",
		"in_reply_to_user_id": 877195967023403000,
		"text": "또라이같은 루치..... 대나무숲이라 고백하는데 저 혼자 또치라고 부르면서 애끼고 있습니다ㅠ 절대 루치를 비하하는 의미가 아니라 진짜 애껴여.... 달랑수염에서 뽑아버린 운전대 찾은 거 같았지만 또치 귀엽구 막 지건할때 속으로 깐따삐아 할 거 같구?",
		"id": 887591291499888600,
		"in_reply_to_status_id": 887590333797630000,
