		"geo": {},
		"id_str": "887590333797629953",
		"text": "아킹님 샘플로 다시 보니 장관님이 국수면발이 아니라 걍 루치가 국수면발처럼 장관을 대했다는 걸 내가 잘 알겠다. 최근화에서 말쩡한 소리를 하던 루치의 본래 모습이 다시 기억났곸ㅋ 에휴 우리 또라이새끼 좀 더 또라이같이 굴어줘 좀더 장관한테 욕 들어줘",
