		"geo": {},
		"id_str": "887343641827594240",
		"in_reply_to_user_id": 877195967023403000,
		"text": "억지력이 있으니 뭘 하든 아무 의미도 없다면 차라리 좋겠지만 아무리 그렇게 생각하려 해도 자기가 결재한 임무 때문에 원작에 등장하지도 않는 이름들이 사망자 목록에 주루룩 나열되어 있으면 책임감을 느낄 수 밖에 없겠지",
		"id": 887343641827594200,
		"in_reply_to_status_id": 887342778694357000,
		"created_at": "2017-07-18 16:09:44 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
		"in_reply_to_user_id_str": "877195967023403009",
