		"text": "어버버하는 장관님 입술을 맘껏 농락해버림. 클리셰에 따라 하토리는 어디 먼 나라 왕자님이라 돈도 많고 외모도 쩔고 부동산도 가진 로맨틱가이라 나를 구해준 당신에게 이번엔 내가 구원이 되겠다며 그대로 장관님 들쳐업고 멀리멀리 사랑의 야반도주 (장:???",
