		"text": "백발홍안에 키크고 잘생긴 나체의 청년이 눈에 사랑을 담고 아 나의 아름답고 상냥한 시뇨르 저는 &gt;&gt;진실한 사랑의 키스&lt;&lt;로만 깨지는 저주를 받아 오랜 세월을 비둘기의 몸으로 살아왔습니다...하고 웃으며 장관님 턱을 들어올려 버드키스~딥키스까지 풀코스로",
