		"id_str": "885569294293127168",
		"in_reply_to_user_id": 877195967023403000,
		"text": "壁の 前に 立っていた サングラスを かけた やつが もたついて 出て, 鏡を 持って来た. 僕は 鏡を 見るやいなや, その 鏡を 床に 投げつけた.\n\nガシャン\n\n部屋の 中の 雰囲気は 非常に 冷ややかになった. しかし 僕の 気持ちが もっと 冷たかった.",
		"id": 885569294293127200,
		"in_reply_to_status_id": 885566844211413000,
