		"id_str": "885566844211412992",
		"in_reply_to_user_id": 877195967023403000,
		"text": "うん, すごく めまぐるしい. 君のせいで.\nくそ 今 僕に 何だと 言ってた?\n\nスパンダム? うん? スパンダム?\n僕が 知っている その スパンダムじゃ ないよね?\n\n\"鏡!!!\"\n\"は, はいっ?\"\n\"鏡 持って来いって!!!!\"",
