		"id_str": "885564757025083392",
		"in_reply_to_user_id": 877195967023403000,
		"text": "鎮痛剤を 注射したのか 少し 良くなった.  効果はやっ.\nえ どころで 少々. 今 僕を 何と 呼んだの?\n\n\"スパンダム主管, 大丈夫ですか?\"\n\"ちょっと, 今 何だって?\"\n\"スパンダム主管, 大丈夫ですかと 聞きました. もしかしてめまいがしますか?\"",
