		"in_reply_to_user_id": 877195967023403000,
		"text": "\"...!!\"\n\"だ, 大丈夫ですか\"\n\n君の目には僕が大丈夫見えるのか!!\nマジ死にそうだ. くそ 今 花と 川が 見えた. あそこで 手を 振っている 方が 私の 母方の おじいさんですか? 間違ったって? すみません.",
