		"id_str": "885560987545239553",
		"in_reply_to_user_id": 877195967023403000,
		"text": "ぼうっと しているのと, 医師に 見える 人が 僕に 言った.\n\n\"スパンダム主任! 正気付きますか?\"\n\n何こら? と 言おうとしたが, 口を 開いた 瞬間 3平方センチの 口内炎に アルボチル(*口内炎治療剤)の 原液を 塗ったような 痛みを 感じた。",
		"id": 885560987545239600,
		"in_reply_to_status_id": 885557902001324000,
		"created_at": "2017-07-13 18:06:07 +0000",
