		"geo": {},
		"id_str": "885557902001324032",
		"in_reply_to_user_id": 877195967023403000,
		"text": "げぇ めちゃ 痛い.\nひどい 傷か 確認しようと 顔を さかのぼって みると, 包帯が ぐるぐる 巻かれていた.\n...包帯? ただ 絆創膏がじゃなくて?\nまさか とても 無残な 顔の道具だから 交通事故の 後遺症だと 思って 整形手術でも させたのか?",
		"id": 885557902001324000,
		"in_reply_to_status_id": 885556154113302500,
		"created_at": "2017-07-13 17:53:51 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
