		"geo": {},
		"id_str": "885556154113302528",
		"in_reply_to_user_id": 877195967023403000,
		"text": "そして 僕は 病院の 救急室に 行くのに なったけど, 中間に 寝たのか 記憶がない.\nくそ 顔が めっちゃ 痛い. さっきは 恥ずかしいかったから 知らなかったけど まさか 顔が アスファルト 地面に 引っかけたのか. 何でか 皆 僕を 見て 痛い 表情を してたような.",
		"id": 885556154113302500,
		"in_reply_to_status_id": 885553574674964500,
