		"id_str": "885553574674964481",
		"in_reply_to_user_id": 877195967023403000,
		"text": "顔が 爆発して 死にそうだった. 拍手しないでよ くそども. なんで 雰囲気 入れて 拍手するの. 僕が 大丈夫だって 断固として 拒否したのに アンビュランスに 乗せた 記者おじ 忘れない. 僕は 救急車 隊員と 気まずく 座って 病院に 行かなければ ならなかったの.",
		"id": 885553574674964500,
