		"id_str": "885553451052158977",
		"in_reply_to_user_id": 877195967023403000,
		"text": "음 장관님이 보좌관에게 하고싶은 말이 있을지도 모른다고 생각했었다니까 자신과 카쿠와 터포키는 실제로 뇌장관과의 대화를 하려던 건 아니었을까요? 아카이누한테 넘기기 전에 이상 생겨서 폐기하게 되었다는 보고만 하면 되었을 것 같은데...",
