		"id_str": "885550701216112640",
		"in_reply_to_user_id": 877195967023403000,
		"text": "차라리 기절시키고 병실에 냅두거나 묶어놨으면 아무것도 할 수 없다는 무력감 정도로 끝일텐데 절대 장관님께 손대지 못할 거라 생각하면서 선택권을 줬다는 건... 분명한 악의가 느껴진다. 와 블루노... 터포키가 그렇게 싫었니...",
