		"text": "それ 記事で 書いて みなよ. 告訴するから.\n人が 車に ひかれたのに 写真撮ってるのか 記者やつら.\n車を 運転していた おばさんが 泣き出せる 一歩手前だったので 僕は がばと起おき上あがった.\nそうしたら 校門の 前に 受験生 皆が 集まって 僕を 見物していてた.",
