		"in_reply_to_user_id": 877195967023403000,
		"text": "터포키가 선뽑기 말고 그대로 따라갔다면 장관님의 고통 &lt; 이기적 욕심이란 선택을 내린건데 게다가 실패해버리면;; 장관님의 바람도 목숨도 지키지 못한 자신을 터포키가 용서할 수 있었을까;;; 블루노 무서워...",
