		"text": "嫌われスパンダムの一生 w.アイスキング\n\n0. ごきげん, 僕の 人生\n\n僕は センター試験が 終わって 一番 最初に 飛び出るあいだに 車に 轢かれた.\n\n車に 轢かれたと 言うのも 恥ずかしいか. 亀の ように 這って行っている 車に 僕が ぶつかったのだ.",
