		"text": "고삼이네 담임쌤이 어땠어? 하고 전화하는데 고삼이가 병원에서 멍하니 전화받자마자 그냥 눈물이 뚝 떨어졌음 좋겠다. 어씨발 뭔데. 나 시험 안 망했는데? 근데 선생님도 괜찮냐고 하고 주변사람들도 긴장 풀려서 그러냐면서 위로해줘서 좀 밍숭맹숭하고 끝나고.",
