		"geo": {},
		"id_str": "885422133253332997",
		"in_reply_to_user_id": 877195967023403000,
		"text": "도피는 자기사람에겐 한없이 스윗한 남자... 장관이 자신을 믿지 않는다는 것을 알아도 장관을 곁에 두려고 했으면 좋겠다 용서하지 못하는 건 배신뿐",
		"id": 885422133253333000,
		"in_reply_to_status_id": 885407400575942700,
		"created_at": "2017-07-13 08:54:21 +0000",
