		"geo": {},
		"id_str": "885407188960763904",
		"in_reply_to_user_id": 877195967023403000,
		"text": "자기사람이라면 마지막까지 믿고 계속 기회를 주려는 도피와 아무도 믿지 않는 장관님도 참 좋아 더 잔인한 사람은 어느쪽인지",
		"id": 885407188960763900,
		"in_reply_to_status_id": 885406315568218100,
		"created_at": "2017-07-13 07:54:58 +0000",
