		"geo": {},
		"id_str": "885404515037364224",
		"text": "앗 도플장관 짱좋은것같아 별 감정도 없는 상대에게 나밖에 모를거다. 그런 것을 위해 죽지 마라. 라고 말하는 장관님과 아주 소중하게 생각하는 상대에게 나를 위해 죽어달라고 말하는 도피 조합 짱이잖아",
