		"in_reply_to_user_id": 877195967023403000,
		"text": "완전히 새로운 몸에 이식했다고 했으니 당연히 외모도 다를 것임에도 특징적인 연보라색 머리카락이 보이면 고개를 돌리게 되버리고.. 이전까지처럼 세계 정부의 명령에 따라야 함에도 혹시나, 혹여나 하는 마음에 이전처럼 쉽게 살인할 수 없게 되어버렸으면😭😭😭",
