		"in_reply_to_user_id": 877195967023403000,
		"text": "마음앓이를 하게 될 것 같구요... 장관에게 전달한 프라이빗 뱅크 봉투 안의 번호를 가진 전보벌레를 계속해서 가지고 다니면서 혹여나 자신을 필요로 하게 되는 날이 오지 않을까 하고, 아무도 알지 못하는 기약없는 기다림을 계속하는 블루노가 보고싶어요.",
