		"in_reply_to_user_id": 877195967023403000,
		"text": "보고 아닐 것을 알면서도 혹시나 저 사람이 장관이었으면 어떡하지. 그 사람은 똑똑하지만 또한 상냥하니까, 이제 위험하지 않고 아무도 자신을 이용하려 들지 않게 되어서도 또 다른 사람들을 지키려다 위험에 처하게 된 거라면 하고, 아무에게도 말할 수 없는",
