		"text": "전 CP9이자 현 CP0는 장관의 죽음 이후로 거의 돌이킬 수 없을 만큼 분열되어 살인까지 날 뻔 하다가 겨우 막아내고 별도로 행동을 하게 되었는데, 함께 활동하게 된 카쿠가 가끔씩 장관을 그리는 말을 하다가도 자신의 임무에 따라 일반인을 암살하는 걸",
