		"text": "길을 걷다가도 자꾸만 주위 사람들을 훔쳐보게 되고, 시발이라고 욕을 하는 사람, 넘어지는 사람, 찻잔을 떨어뜨리거나 혹은 포도맛 환타를 마시는 사람 모두가 혹여나 자신의 장관일까, 혹시라도 방금 지나간 저 사람이 그였을까, 하고 홀로 생각할 것 같아요",
