		"geo": {},
		"id_str": "884765452144001024",
		"in_reply_to_user_id": 877195967023403000,
		"text": "혁명군이던 뭐건 푸딩 네가 있었으면, 하고 바라는 게 맞다. 다시 둘이 만나는 날이 고대되면서도 걱정되는 이유도 이것... 장관이 푸딩의 고민했던 걸 알면 뭐라 답할 것이며 푸딩이 장관의 생각을 알면 어떤 감정을 가지게 될까, 같은거.",
