		"id_str": "884703411094016000",
		"text": "블라썸♂도 화장품 2호점 낼 계획 짜고있어도 귀엽겠다... 앗 블라썸 사장님에 블라썸♂ 점원인 화장품점. 손님의 호칭은 아가씨와 도련님인데 블라썸♂은 한 보랏빛 남자가 온 날 가장 활기차게 상품을 권함. 도련님!! 제가 발라드릴게요! 예쁘셔요! (뭐?",
