		"text": "난 진짜 블루노도 그렇지만 지금 터포키 기분을 상상조차 할수없다.....안그래도 자책하고 있었는데 자기 손으로 장관님  죽인꼴.....와... 장관님 일어나도 그 앞에 나타날수나있나ㅜㅜ...터포키 하는일마다.....",
