		"id_str": "884424299704049664",
		"text": "카라멜이랑 허니 블라썸이 둘 다 있으면 장관님의 신뢰감도 두 배 배신감도 두 배.\n원플원이벤트 같네요! 솔직히 장관님은 푸딩들한테서 안정감을 느꼈을 것 같은데 둘다 혁명군이야(빠밤",
