		"geo": {},
		"id_str": "884423608793145344",
		"text": "무표정이여도 올라간 입꼬리인 사람이 있던데 그게 푸딩들이여도 좋겠다. 차이는 카라멜은 배어버린 미소고 허니 블라썸은 진짜 입이 올라가있다. 둘다 정말 싸늘한 표정을 지을 때 갭이 좋음...",
