		"text": "카쿠와 블루노는 장관이 하고 싶은 말이 있을거 아니냐는 말로 본인들이 더 듣고 싶어하는 마음을 감추고 뇌둥둥을 기회라 했지만\n똑같이 장관님에게 묻고 싶었던 게 많은 터포키는 그 기회를 자길 위해 쓰지 않고 장관을 위해 썼다ㅠㅜㅠ 터포키 순정 진짜ㅠㅜㅠ",
