		"geo": {},
		"id_str": "884276488593223680",
		"in_reply_to_user_id": 877195967023403000,
		"text": "보지 않으면 안돼는 직업병에 걸려라. 보다보면 여기나 저기나 세상 돌아가는 일은 별로 다르지 않네 하면서 언론에 안나오는 정치적 커넥션 같은거 추리해볼듯.\n\n어느날 대학 친구들이랑 술마시러 갔는데 식당 티비에 뉴스가 나오면 새내기들이 이제 자기도",
		"id": 884276488593223700,
		"in_reply_to_status_id": 884276099290611700,
