		"in_reply_to_user_id": 877195967023403000,
		"text": "정상전쟁 때 장관님 웃는 모습 보고 처참하기도 하지만 그런 표정은 처음이라 푸딩/터포키/cp들 내심 놀라지 않았을까. 피범벅인 거 빼면 정말로 그동안 본 가장 밝은 얼굴이라서 대충격. 저렇게 웃을 수 있는 사람이었나?",
