			"text": "서로 꿈에서 만나는데 서로 진짜 만난거지만 꿈일 뿐이라고 생각하는 푸딩스파. 혁밍아웃 이후 장관님 나오는 꿈꾸는 푸딩과 푸딩이 나오는 꿈꾸는 장관님. 서로 솔직하게 '당신을 죽이고 싶지 않았는데 죽이지 않아서 다행이었다' '널 믿었는데 실수라고 하지'",
