		"in_reply_to_user_id": 877195967023403000,
		"text": "언제나 푸딩의 무의식을 맴돌며 모든 꿈을 악몽으로 만들어버리는 장관님 유령(?)이 보고시ㅍㅓㅆ다... 푸딩은 결국 장관님이 태생과 가치관의 충돌을 못이겨 죽었다고만 생각하게ㅉㅣ (그리고 실제 고삼이는 죽고 나서 아ㅅㅂ꿈하고 깼으므로 해피엔딩",
