		"text": "장관님은 점점 꿈과 현실을 혼동하면서 무기력증→자살충동을 보임 (스팬담이 된 것 자체가 꿈인 것처럼 느껴지는 고삼이) 하지만 푸딩은 불안증세의 원인이 세계정부에서 벗어나고픈 갈망이라 착각해버리고...",
