		"text": "인셉션au로 장관님 꿈 속에 잠입해 세계정부에 대한 불신을 심는 커스터D. 카라멜. 푸딩이라는 이름의 보좌관으로 장관님 곁에 있으면서 정보조작으로 '세계정부가 장관을 죽이려 한다'는 생각을 심으려 하지만 오히려 장관님 현실감각만 떨어뜨려버림",
