		"in_reply_to_user_id": 877195967023403000,
		"text": "말하고서 장관은 이 빌어먹을 뇌는 자의식 과잉이 틀림 없다 생각했다. 카쿠에게 들은 대답은 한달 전과 같았다. 그래, 그렇단 말이지. 환장하겠네 진짜. 장관은 급기야 카쿠를 탓하기 시작했다. 그 다음엔 자신을 탓했다. 괜히 안하던 짓을 해서.",
