		"in_reply_to_user_id": 877195967023403000,
		"text": "그러니까, 카쿠의 행동에 묻어나는 크고 작은 애정 같은 것. 애정이란 단어를 쓰면서 장관은 책상을 몇번이나 내리쳐야했다. 주먹이 아파 얼마 안가 그만두었지만. 장관은 괜히 자신이 자신감이 넘쳐나는게 아닌가 싶기도 했다.",
