		"in_reply_to_user_id": 877195967023403000,
		"text": "천천히 생각하라고 보통이면 그 아래의 아이들을 시켰을 임무를 일부러 기간도 조금 늘려서 카쿠를 주었다. 그나마도 카쿠가 핑계를 대며 장관을 피한 탓에 서면으로 블루노를 통해 전달했다. 카쿠가 없는 사법섬에서, 장관은 냉정히 상황을 정리하기 시작했다.",
