		"geo": {},
		"id_str": "883716982616408065",
		"in_reply_to_user_id": 877195967023403000,
		"text": "집무실에 혼자 남은 장관은 머리를 싸매고 쇼파에 쓰러지듯 누웠다. 미치겠네, 정말 방금 내가 뭘 들은거야. 미안하다거나, 잘못했다는 반성의 소리는 듣고 싶었던게 맞다 하더라도 사랑 고백까지는 생각해 본 적도 없었다. 이제 뭘 어떡해야하지?",
