		"id_str": "883700137553309696",
		"in_reply_to_user_id": 877195967023403000,
		"text": "카쿠가 괘씸했다. 그래도 자신은 이름뿐인 직책이라지만 나름 장관이었고, 어이없는 일이지만 기억상실에 걸렸다. 아무리 그래도 그렇지. 꼭 이런걸 가지고도 놀려먹어야했나? 이유는 그것 뿐이었다. 며칠간은 더 아무것도 모르는 척 하기로 한 것은.",
