		"geo": {},
		"id_str": "883697576876294144",
		"in_reply_to_user_id": 877195967023403000,
		"text": "그리고 두번째로 퍼뜩 떠올린것은 카쿠였다. 그 때 장관은 육성으로 어떻게 카쿠 그 자식은 이 틈을 잡아서 되도 않는 장난짓을 하냐며 욕을 퍼부었다. 안에서 들리는 소란에 보좌관이 뛰쳐 들어오기도 했다. 장관은 어이가 없었다. 뭐? 사랑? 누구랑 누가?",
