		"in_reply_to_user_id": 877195967023403000,
		"text": "여느 날 처럼 자고 일어난 아침이었다. 그 날 일어나서 아침의 멍한 기운이 가시자마자 장관이 무슨 생각을 했냐하면, 첫 번째는 어떻게 되어먹은게 사람이 자기 발에 걸려 넘어져서 기억상실에 걸려? 미친거 아냐? 였다.",
