		"text": "장관은 문이 열리고, 닫히는 소리가 들릴 때 까지 그러고 있었다. 장관은 무슨 심경의 변화인지 멋대로 입을 놀린 자신을 탓했다. 그딴건 또 왜 물어본거야. 한 번이면 족했잖아. 정말로. 장관은 벌써 한달 전이 되어가는 날을 떠올리며 또 머리를 싸맸다.",
