		"text": "아니지. 떠나지 말았어야 했다. 그가 귀찮다며 떨쳐내도,  곁에 남았을 수 있었다. 그랬어야 했다. 그랬다면 이런 후회는 없을텐데- \n\n장관, 미안하다는 말이 듣고 싶다고 생각했는데, 나는 미안하다고 말하고 싶었던 거였구먼",
