		"text": "장관, 그 때 곁에 있으라고 말해줬다면, 나는 그곳에서 죽더라도 장관을 지켰을 거라네. 장관에게 도움이 되었다는 것만으로도, 아마 기뻤을 거야. 그걸 알면서 그리 매정히 나를 보냈나? 대체 왜 내게 아무것도 기대하지 않았나?",
