		"text": "버스터콜로 무너질 걸 알았을텐데, 하필이면 '건물은 적당히 부숴라'니 그렇게 의미없는 인사가 또 있을까. 그가 내게 남긴 마지막 말조차 아무런 의미가 없다- 나는 그에게 아무런 의미가 없다. 한 번도 의미있었던 적이 없었다",
