			"geo": {},
			"id_str": "883153020598468609",
			"text": "혐스일에서도 안나오더라도 아카이누 원수 취임식 있겠지? 그때 의전담당이 장관한테 정의코트 비슷한 흰코트 걸쳐줬는데 몇번 툭툭 건드리더니 떨구고 가버려서 분위기 싸해지면 좋겠다. 통상적으로 cp9은 안입지만 통일성+아카이누가 장관이 자기 소관임을 나타내",
