		"id_str": "883371420524335105",
		"in_reply_to_user_id": 877195967023403000,
		"text": "톡톡 소리가 멈췄다. 야, 그... 뭐냐. 장관은 잠시 머뭇거리는가 싶더니 말했다. 너 있잖아. 내가 왜 좋다고 했지? 카쿠는 말의 저의를 파악하려 머리를 굴렸다. 지금 놀리는건가? 카쿠는 슬쩍 고개를 들었다. 그런데 장관의 표정이 사뭇 진지했다.",
