		"in_reply_to_user_id": 877195967023403000,
		"text": "시간이 얼마 지나지 않아 카쿠는 새 임무를 맡았다. 난이도는 그다지 높지 않았으나 기간이 평소 맡던 것보다 배는 길었다. 카쿠는 군말 없이 임무를 받았다. 기간이 긴 이유가 자신이 보기 싫어서라도 할 말이 없었다.",
		"id": 883364331869544400,
