		"in_reply_to_status_id_str": "883348458375004160",
		"geo": {},
		"id_str": "883348676634001408",
		"in_reply_to_user_id": 877195967023403000,
		"text": "그런데 장관은 꼭 아무렇지 않다는 듯 말하곤 다시 잠이 들었다. 평소였으면 이러지 않았을텐데. 왜 꼭 연인처럼, 여기까지 생각했을 때 카쿠는 무엇이 잘못되었는지를 깨달았다. 둘은 지금 연인이나 다름 없었다. 아. 장난으로 던진 그 한마디 때문에.",
