		"geo": {},
		"id_str": "883341937415041030",
		"in_reply_to_user_id": 877195967023403000,
		"text": "한참을 그러고 있다가 장관의 머리칼을 매만졌다. 평생에 장관이랑 할 스킨쉽을 몰아서 오늘 다 하는 것 같았다. 볼에 조심스레 손을 대 보았다. 창백한 피부 때문에 차가울 것 같았는데. 의외로 따뜻했다.",
		"id": 883341937415041000,
