		"text": "시력 약화의 클리셰는 그것이지요 머리 염색해서 넘기고 안경 껴 변장•잠입한 푸딩 아무도 못 알아보는데 혼자 목소리만으로 알아보는 장관과 드물게 일그러진 푸딩의 표정 흐릿한 시야 탓에 사법탑에서처럼 뻔뻔하게 웃는 얼굴이겠지 넘겨짚고 쓴웃음 짓는 장관",
