		"geo": {},
		"id_str": "883202809193037824",
		"in_reply_to_user_id": 877195967023403000,
		"text": "고개를 푹 숙이고 자는것이 굉장히 불편해보였다. 자고 일어나면 목이 아파 고개를 들지 못할지도 몰랐다. 장관은 그만큼 약했다. 카쿠는 고민하다 제 어깨에 그를 기대게 했다. 하지만 교정기에 눌려 그게 더 불편한 모양인지 장관은 잠결에 인상을 찌푸렸다.",
		"id": 883202809193037800,
		"in_reply_to_status_id": 883202142084898800,
		"created_at": "2017-07-07 05:55:33 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
