		"id_str": "883197439049474048",
		"in_reply_to_user_id": 877195967023403000,
		"text": "원래 장관은 누군가에게 의지하는 성격이 아니었으니까. 옆에 8년이나 있으면서 그가 자신들에게 의지한다는 느낌은 한 번도 받지 못했다. 그래서 장관에게서 이상한 기시감이 느껴졌지만 그것이 자신에게 의지 하고 있어 생기는 것인줄도 몰랐다.",
		"id": 883197439049474000,
		"in_reply_to_status_id": 883196721290920000,
		"created_at": "2017-07-07 05:34:13 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
