		"id_str": "883193343945039872",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관의 앞에서는 태연하게 웃었지만 제 방으로 돌아와서는 아니었다. 속에 커다란 돌덩이가 얹힌 기분이었다. 숨이 턱턱 막혔다. 지금 내가 뭘 하고 있는거지? 이럴 생각은 아니었는데. 정말로. 카쿠는 입술을 꾹 깨물었다.",
