		"text": "을 정도로 블루노를 향한 신뢰도도 높았으니... 그리고 블루노만큼 다른 이들에게 신뢰받는 사람도 없었을거다. \n결론을 말하자면\n블루노는 스팬다인의 편이며 카쿠의 제안에 협력하는 척 장관님을 빼돌릴 계획이다. 루치측과 카쿠측이 싸우는 사이 어부지리로.",
