		"text": "고삼이 친구 트립해왔으면 좋겠다. 같이 원피스 보던 친구에 자기 몸이니 꺼리낄 게 없어서 씽나게 기웃거리다 장관님 마주치자. 음, 김고삼이 겁나게 혐오하던 새끼네. 하다 느낌이 좀 달라서 자세히 보고 성격은 좀 바꿔었지만 ...○○? 하고 알아봤으면.",
