		"in_reply_to_user_id": 877195967023403000,
		"text": "장관은 카쿠에게 이것 저것을 시도때도 없이 물었다. 우린 데이트 같은 것도 했어? 그 때는 주로 뭘 했어? 같은 것들. 이 때라도 카쿠는 진실을 고백했어야 했다. 하지만 그러지 못하고 거짓말을 늘어놓았다. 피노키오가 따로 없었다.",
