		"geo": {},
		"id_str": "882997518652456960",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관은 카쿠에게 물었다. 자기가 어떤 사람인지, 네가 CP9라는 직책에 있다는 것 까지는 들었다. 그런데 그게 무엇이고 우리는 무슨 관계인지는 잘 모르겠다고 했다. 카쿠는 순순히 설명해주었다. CP9는 장관의 직속, 상사와 부하같은 것이라고.",
		"id": 882997518652457000,
		"in_reply_to_status_id": 882996944271949800,
