		"geo": {},
		"id_str": "882996944271949824",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관은 카쿠와 마주 앉아 이야기를 나누었다. 당시에 어쩌다보니 다른 CP9들은 임무로 자리를 비운 상태였다. 소식을 전했으니 다들 임의로 빠르게 끝내고 돌아올 터였다. 평소라면 장관이 화를 냈겠지만 그 장관이 지금 백지 상태였기 때문이다.",
		"id": 882996944271949800,
		"in_reply_to_status_id": 882996475239686100,
		"created_at": "2017-07-06 16:17:31 +0000",
