		"text": "잠깐 둘이 춤배우는 것도 좋고 장관님 사교회의 주역 되버리는 것도 좋고 다 좋은데 장관님 사이즈 차이... 괜찮나...? 푸딩은 범인의 범주이니 무난히 췄지만 분명 원피스 세계에는 규격 외의... 인물이... 장관님 매달려다니는 거 아냐...?",
