		"geo": {},
		"id_str": "882990502181609472",
		"in_reply_to_user_id": 877195967023403000,
		"text": "푸딩이 계속 상대의 춤예절이 이러면 형편없는 거니 거절하세요. 상대가 만약 이런 행동을 취한다면 거절의 이유로 충분한 문젭니다. 이런 거 말해줬으면. 이 새끼는 왜 아까부터 자꾸 거절하라지. 나랑 춤추기 싫다고 돌려말하는 거?",
