		"id_str": "882990431126016000",
		"in_reply_to_user_id": 877195967023403000,
		"text": "\"네가 리드잖아. 하는 대로 따라가면 안 돼?\"\n\"장관님. 춤을 리드한다는 건 먼저 움직인다는 뜻이지 상대를 끌고다닌다는 뜻이 아닙니다. 리드를 따르셔도, 끌려다니지 않으셔야하죠. 만약 상대가 배려없이 밀고당긴다면 그 무례를 이유로 거절하셔도 됩니다\"",
