		"in_reply_to_user_id": 877195967023403000,
		"text": "밀고당기는 힘에는 적절히 저항해 팔의 굽힌 각도를 유지하세요. 상대와 일직선이 되도록, 네, 여성 측은 오른발부터, 몸의 체중은 딛은 발에 실으세요. 힐이 아닌 볼에... 외우긴커녕 하나 따라가기도 벅찬데 푸딩이 줄줄 읊는 거에 혼이 나가겠지.",
