		"text": "춤을 신청하는 동작, 젠틀하게 내민 손.\n내가 이걸 영화에서나 봤었는데. 해볼 일이 있을 거라곤 몰랐지.\n그 손 위에 수락한다는 뜻으로, 손을 얹으며 생각했다.\n시발 여자 쪽일 거라곤 더더욱 몰랐고.\n\n푸딩×오장관님 크로스로 사교댄스 보고싶다.",
