		"id_str": "882648669547241472",
		"in_reply_to_user_id": 877195967023403000,
		"text": "나중? CP0은 다시 심기가 불편해졌다. 우리가 있을 적에는 돌아가라고 성화였으면서 나중에 다시 오라니. 기분이 상했다. 내색은 하지 않았다. 하지만 장관은 자세한 이유는 모르나 그들이 또 심기가 불편해졌음을 알았다. 그것이 치타 때문인 것도 알았다.",
