		"text": "치타는 장관에게 가까이 와 임무를 보고했다. CP0은 그 모습이 그래도 제법 CP9같다고 생각했다. 대견하다거나 그런건 아니었다. 그저 사람 구실은 하는구나 정도. 보고를 마친 치타는 허리를 조금 숙였다. 장관은 한숨을 내쉬곤 머리를 쓰다듬어 주었다.",
