		"in_reply_to_user_id": 877195967023403000,
		"text": "그런데 운 나쁘게도 치타는 CP0들이 집무실에서 장관과 이야기를 나눌 때 찾아왔다. 똑똑, 들리는 노크 소리에 장관은 들어오라고 답했다. 그리고 고개를 내민것이 치타였다. 치타는 볼에 작은 반창코를 붙이고 있었다.",
