		"geo": {},
		"id_str": "882642886260514820",
		"in_reply_to_user_id": 877195967023403000,
		"text": "치타가 자리를 떠나고 CP0과 장관은 도란도란 이야기를 나누었다. 서로의 근황, 혹은 사소한 이야깃거리들을. 장관의 태도는 예전과 꼭 같았다. CP0은 왠지 서운해졌다. 누군가 현 CP9는 어떻냐고 물었다. 너희보단 못하다는 대답이 듣고 싶었다.",
