		"geo": {},
		"id_str": "882638722545598464",
		"in_reply_to_user_id": 877195967023403000,
		"text": "처음에는 기겁하던 장관도 온순한 성격의 그가 고양이 마냥 애옹 울면서 다리에 얼굴을 비비는게 익숙해졌고. 귀엽게 보이기도 했다. 사람 모습으로 있을 때에도 그는 싹싹했고 장관의 기준에서 정상적인 CP9였다. 장관은 그 치타를 예뻐했다.",
		"id": 882638722545598500,
		"in_reply_to_status_id": 882638074152271900,
		"created_at": "2017-07-05 16:34:04 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
