		"geo": {},
		"id_str": "882638074152271872",
		"text": "집무실에 들어온 치타 한마리... 그 치타는 정상전쟁 이후 CP9의 빈자리를 채운 신 CP9중 하나. 고양고양열매, 모델 - 치타 를 먹은 악마의 열매 능력자였다. 애교 많은 성격의 그는 치타의 모습을 하고 장관님 방에 들어와 애옹하고 울었다.",
		"id": 882638074152271900,
		"created_at": "2017-07-05 16:31:30 +0000",
