		"text": "RT @naya_spall: 장관의 움직이는 사법섬으로 에이스가 캘시퍼이면 귀엽겠다. 장관네 화덕에 있을 때는 쟈근 에이스이지만 밥먹을 때는 인간 사이즈로 돌아와서 장관은 오늘도 식비를 벌기 위해 출근을 합니다...써놓으니까 넘 슬픈데ㅇㅅ;ㅇ",
