		"in_reply_to_user_id": 877195967023403000,
		"text": "수능 끝나고는 가끔 집에 와서 낮잠을 자다 일어나 밤을 세고 학교에 가기도 했으니까. 그날은 유독 졸렸지만 나 어제 너무 늦게 잤나? 정도로 생각하고 누웠겠지. 고삼이는 곧 눈을 감고 잠에 들고...",
