		"id_str": "882602321988919296",
		"in_reply_to_user_id": 877195967023403000,
		"text": "내려가면 좃되겠다 싶은거임... 그래서 아무도 안가려하지만 그래도 명색이 사해팔황 다스리는 천궁인데 손을 안 쓸수도 없고 어쩔까하다 저 기억속에 처박혀잇던 장관님이 생각난거. 비록 능력은 없지만 어쨌든 따지고보면 천군의 혈육이니 우습지는 않게된거고",
