		"in_reply_to_user_id": 877195967023403000,
		"text": "어느 날은 수능 이후 단축 수업을 시작한 학교가 오전 수업만 하고 끝이 나서 집에 돌아왔는데, 잠이 쏟아져서 느긋하게 낮잠이나 자고 일어날까 하면서 쇼파에 누웠을거다. 아무 의심도 없이.",
