		"in_reply_to_user_id": 877195967023403000,
		"text": "정말 놀이공원도 갈거야. 수능 끝난 기념으로 가족여행도 갈거고. 수능 공부하느라 못봤던 원피스도 몰아 보면서 꿈에서 자신이었던 스팬담이랑 CP9 욕도 하고, 아이스버그는 보면서 음, 그래 넌 꿈에서도 좋은 애였지. 하겠지.",
