		"text": "다들 예우는 하지만 척일 뿐이고 당사자도 워낙 두문불출하니까 잊어가고있었겠지 그러다 천계의 실수로 인간계에 큰 일이 터져서 혼란스러워져서 천계에선 이걸 또 수습하긴 수습해야겠고.. 일단 지들 잘못이니까\n근데 주요인물들의 운명(약간의 미래)을 보니",
