		"text": "크로커다일 재판 ~ 정상전쟁 잠시 빼곤 본래 의욕없는 장관이었지만 더더욱 일할 의지가 사라진... 흐물텅한 장관님... 사법섬이야 혁명군 스파이 밑에서도 잘 굴러갔는데 알아서 할테고 장관님 정신상태가 하도 메롱하니까 요양이나 보내줬음 좋겠네",
