		"text": "신선AU로 천군의 혈육(먼 친척이긴하지만)이고 천궁에서 오랫동안 살아왔지만 그 능력이 미약해서 제대로 대우하는사람 없고 스스로도 은둔생활을 즐기는 장관님 보고싶다",
