		"id_str": "882188439633895425",
		"in_reply_to_user_id": 877195967023403000,
		"text": "재브라가 울었던 그 자리에서 장관에게 연결된 호스 뽑고 8년동안 익숙할 정도로 지어왔던 미소 지으며 못다한 작별인사를 하러 왔습니다 하는데 눈가가 뜨겁고 목이 매캐하고 손 안 철제 가드는 찌그러져있는",
		"id": 882188439633895400,
		"in_reply_to_status_id": 882188400501051400,
		"created_at": "2017-07-04 10:44:48 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
