		"geo": {},
		"id_str": "882188343815020544",
		"in_reply_to_user_id": 877195967023403000,
		"text": "사실 떠올리며 이제는 뇌장관 이용당하게 둘 수 없어서 장관을 죽여야 할 때의 푸딩의 심정... 사보에게 전해들었을 때 머리도 눈치도 좋으니까 장관이 정말로 자신을 신용했음을 어렴풋이라도 깨닫지 않을까 전해듣기 전엔 장관에 대한 복잡한 심정 삼키고",
		"id": 882188343815020500,
		"in_reply_to_status_id": 882188259270381600,
		"created_at": "2017-07-04 10:44:26 +0000",
		"in_reply_to_screen_name": "spandambamboo3",
