		"id_str": "882188259270381569",
		"in_reply_to_user_id": 877195967023403000,
		"text": "명령도 쌩까고 장관 빼돌려가며 다시는 그러지 마십시오 하면서 화냈던 푸딩이 정상결전 이후 사보에게 사실 장관은 자살하려던 게 아니었다고 전해 듣고 계단에서 쓰러진 장관이 자기 찾던 목소리의 진정성과 장관의 진통제 과다복용은 자신 탓이나 다름없다는",
		"id": 882188259270381600,
