		"text": "최신화 보고 나니... 루치 장관님 좋아하게 되면 마음 깨닫자마자 장관님한테 가서 자기 마음 똑바로 고백할거란 생각에 확신이 들었다.. 그러면서 당신이 이렇게 유능한 cp9인 나를 안 좋아할리가 없다면서 계속 구애하겠지.. 장관님 마음 젠젠 신경안씀😇",
