		"geo": {},
		"id_str": "881575973212139520",
		"in_reply_to_user_id": 877195967023403000,
		"text": "다 장관님에 대한 애정이 있으니까 자책하고 서로 원망하는 건데 장관님 생각은 아 내가 아파서 꼴이 웃기니까 표정 쎄한가? 지들끼리 또 왜 쌈질이야;; 으 죽을만큼 아픈데 죽어버렸음 좋겠네 그럴 듯 (그리고 다 들리게 말해버림",
		"id": 881575973212139500,
		"in_reply_to_status_id": 881574141198872600,
