		"geo": {},
		"id_str": "881572158530404352",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관님 약한 건 일반상식이라지만 구체적인 증상은 약점이니까 푸딩이든 터포키든 cp9든 가장 가까이서 돌보는 사람이 전담하고 숨기려 하겠지. 즉 나는 장관님의 눈물나게 아픈 모습을 차례로 깨달으며 고통스러워하는 주변인을 보고싶다 (뭐가 문제",
		"id": 881572158530404400,
		"in_reply_to_status_id": 881571403161493500,
