		"geo": {},
		"id_str": "881571403161493504",
		"in_reply_to_user_id": 877195967023403000,
		"text": "터포키라면 장관님 이렇게까지 아픈 것도 다 푸딩 때문이라 생각해버릴 듯. 실제 푸딩이 기여한 건 인간불신증 + 전신타박상 + 진통제 과다복용 후유증 정도지만 (아 이것도 적은 건 아니네...",
