		"geo": {},
		"id_str": "881565188415148033",
		"text": "장관님 솔직히 불면증에 시달릴거같음 자다가도 고통아니면 악몽때문에 매일 새벽에 일어났다가 다시 잠드시겠지..숨긴다고 숨기는데 악몽에ㅜ시달리는날은 잠꼬대로 들키고 고통에 시달리는날은 신음소리때문에 다 들킬ㄹ것이다,,",
