		"in_reply_to_user_id": 877195967023403000,
		"text": "장관님 발견해라. 장관님이 그제야 고통으로 일그러진 얼굴로 문쪽 흘깃 보고 아-, 하고 침음 내뱉다가 무릎걸음으로 침대 옆 탁자 안보고 휘저어서 진통제 찾아라. 탁자 위 엉망으로 흩어진것도 신경 안쓰고 진통제 탈탈 털어서 입안에 밀어넣고",
