		"text": "애들은 자기 방에서 자거나 각자 활동 하다가 장관님 비명소리 듣고 장관님 방으로 달려가라. 스팬담!!! 하면서 루치가 문 쿵쿵 두드리는데 아무 대답도 없으니까 카쿠가 문 쾅 부숴서 열었더니 어둑한 방 안에 침대에서 굴러떨어진 채로 얼굴 감싸고 있는",
