		"text": "묶었다 싶으면 엉성해서 여기저기 튀어나오고 하니까 계속 낑낑거리면서 재시도하는데 장관님 시선이 위에서 아래 내려다보는거니까 집중하다보니 점점 고개 아래로 내려갈 듯. 멀뚱히 장관님 하는 거 보던 루치가 갑자기 고개 들어서 한껏 숙인 장관님한테 뽀뽀하고",
