		"text": "한 손으로 열심히 모으면서 자를 생각은 없냐구 물어보면 아직은 없다고 그러는 루치. 으응, 그렇구나- 하고 다시 머리묶기 집중해라. 장관님 남자였고 특히 내 머리 묶는거랑 다르게 남 머리 묶으면 고무줄에 손 꼬이고 그런일 많으니까 잘 안돼서 끙끙대라",
