		"text": "루치가 뭔소리냐는 듯이 눈썹 올렸다가 반짝반짝한 장관님 얼굴 보고 그냥 고개 끄덕여라. 급 신나서 머리끈 찾아가지고 루치 뒤에 앉아서 머리 만지작거리는 장관님. 머리숱 장난 아니라서 놀랄 것 같다. 와, 이걸 어떻게 관리하냐... 이러면서ㅋㅋ",
