		"text": "신경쓰지 말라지만 너무나도 신경쓰였던 장관님은 결국 cp들에게 묻게 되고... 운명의 상대 네임에 대해 듣게 되어버려서 엄청 허탈... 커스타D. 카라멜이라니.. 푸딩놈 D의 일족이었던 거냐고... 하면서 현실 도피하다가 어이없어서 벙찌고..",
