		"in_reply_to_user_id": 877195967023403000,
		"text": "그렇게 정상결전 지나가고 장관님 깨어나고 재활하는데 세수하다가 그제서야 네임 보게 됐으면..근데 원래 세상에는 네임이 없었어서 이게 뭐지, 하고 터포키한테 물어보는데 (누가 봐도 뭐가 있는 말투로)아무것도 아닙니다 증근늠... 이래버리고..",
