		"text": "푸딩이 떠난뒤로 서서히 새겨진건데 장관님은 거울 안 보고 교정기도 자기가 차니까 아무도 눈치 못챈거면.. 사실 유일하게 터포키는 장관님 옆에서 보좌하다가 먼저 발견하긴 했는데 엄청 부들부들(프락치가 ㅂㄷㅂㄷ) 거리면서 일부러 말 안해줬던 것이다.",
