		"text": "혼자서는 등뒤를 볼일이 없으니 모르고 있다가 치료해주는 사람이 카라멜씨 이 문양은 뭔가요? 하게되고.. 때마침 혁명군에 몸을 의탁하고 있던 로빈이 이건 포네그리프..? 해버리고.. 혼파망.. 한편 장관님도 교정기안에 푸딩 이름 새겨져 있었으면..",
