		"text": "그 터포키 대타 CP는 당연히 장관님 시중 드는 담당이 따로 있다고 생각했지 설마 직속 보좌관이 다 하는줄은 몰랐다고하자. 이 CP는 나중에서야 자기가 무슨 실수를 했는지 깨닫고 사색이 됐다고 합니다 다 터포키가 인수인계 제대로 안하고 출장간 탓이다",
