		"geo": {},
		"id_str": "881304139296145409",
		"in_reply_to_user_id": 877195967023403000,
		"text": "매력있는 복부일세… 하면서 씨피나인들이랑 죄다 장관님 배 한번씩 꾹꾹이 해보고 싶곸ㅋㅋㅋ 장관님은 아ㅏ 시바 ㅅㅂ 하면서 스트레스 받아버리기…",
		"id": 881304139296145400,
