		"text": "아니 이 낯익은 부담스러움은?? 하고 장관이 '야 너..혹시 터포키...?' 이러면 터포키의 눈물샘은 폭발할 거시다..\n\n해리포터포키가 장관님 어디 데이신 덴 없냐고 옷을 갈아입으셔야하는 것 아니냐면서 대성통곡하면 교장실은 혼파망의 소용돌이에",
