		"text": "사실 터포키는 첫눈에 나의 장관님을 알아본것이어따..(트루럽) 교정장치 부근을 매만지던 버릇이라든가, 말투, 놀랐을 때의 반응, 무뚝뚝한 상냥함 등은 분명 장관님의 것이었고, 핫초코 쏟는 데서 확실해짐&lt;&lt;",
