		"text": "장:그래..에지콤 양이라 그랬나? 여기 핫초코라도 마시면ㅅ...핫 쏟아버렸다!!\n터:장관님!!!! 괜찮으십니까?!!!!\n장:??\n덤:????\n엄:??\n기타등등:?????",
