		"text": "증언하라고 윽박지름. 고삼이는 여자애가 좀 짠해져서 뭔가 따뜻한 거라도 마시고 천천히 하라고 함. 말 마치자마자 집요정이 뿅하고 핫초코를 들고 나타나서 개깜놀했지만 어쨌든 고맙다하고 받아듦.",
