		"text": "장:어...음.. 그래. 불법적인 조직을 만들었다지?\n터:아닙니다.(단호)\n장:(와씨 해리포터 박력 개쩌는데??)그렇군. ....그렇다는데?\n엄:증인이 있습니다, 장관님! \n\n엄브릿지가 얼굴에 밀고자라고 쓰여있고 흉한 종기까지 난 여자애를 데려와서",
