		"in_reply_to_user_id": 877195967023403000,
		"text": "들어오는 해리포터랑 분홍두꺼비 등등을 직접 보니 죽어버리고 싶었음. 분홍두꺼비가 자꾸 의미심장한 시선으로 부담스럽게 쳐다보는데 뭐라도 말해야할것 같아서 더듬더듬 입을 뗌.",
