		"id_str": "881156588077064192",
		"in_reply_to_user_id": 877195967023403000,
		"text": "이럼서 사는중이었음. 어쩌면 영웅이란 칭호를 진심으로 싫어할 수도 있겠다. 진짜 영웅의 삶을 옆에서 지켜본 입장에서, 아무것도 아닌 갓난쟁이를 영웅으로 떠받드는 꼴이 같잖아서.",
		"id": 881156588077064200,
		"in_reply_to_status_id": 881156245251424300,
