		"geo": {},
		"id_str": "881156245251424256",
		"in_reply_to_user_id": 877195967023403000,
		"text": "장관님이 돌아가신 후 검돼단을 모조리 씹어먹은 터포키는 장관님 무덤 앞에서 자살로 생을 마감함. 그리고 해리포터포키로 환☆생. 근데 다시 태어나도 장관님이 없는 삶은 의미가 없기떄무네 이모네가 괴롭혀도 무덤덤 니가 마법세계를 구한 영웅이라해도 무덤덤",
