		"text": "오장님으로 영고재브라 보고싶내.. 오장님이 장관하고 있을때도 스팬다인한테서 꾸준히 선자리나, 중매 등등 들어오는데 내용물이 19세 남고딩인 오장님은 귀찮기만 함. 그래서 편지같은거 대강 읽고 영어못해도 결혼이나 머 그런 간단한 건 읽을 수 있으니까",
