		"text": "장관님은 엄청 구르는반면 오장님은 여러곳에서 사랑받고 푸딩도 혁명군보다 장관님을 더 위하니까 장관님이 억울해하지않을까 했는데\n\n삼대장 cp9 보좌관이랑 연애 플래그 세우고 역하렘 vs 데드 플래그 세우고 걍 죽기\n\n장관님: 시발 닥후",
